!function(window,undefined){let baseUrl=window.location.origin;function serialize(form){let requestArray=[];return form.querySelectorAll("[name]").forEach(elem=>{requestArray.push(elem.name+"="+elem.value)}),requestArray.length>0&&requestArray.join("&")}const formLogin=document.querySelector("#formLogin");null!=formLogin&&formLogin.addEventListener("submit",event=>{event.preventDefault();let action=formLogin.getAttribute("action");serialized=serialize(formLogin),axios.post(action,serialized).then((function(response){response.data.status?(window.location.href=baseUrl+"/page",toastr.success(response.data.msg)):toastr.error(response.data.msg)}))})}(window);